
/**
 * @template T
 * @param {T} a
 * @param {T} b
 */
export const assertEqual = (a, b) => {
    if (typeof a !== typeof b) throw new Error(`typeof expected ${typeof a} different from ${typeof b}`)
    if (a !== b) throw new Error(`val of expected ${a} different from ${b}`)
}

